import React, { useState } from "react";

function Pro({obj}){

    const [object, setobject] = useState([
      { id: 1, name: 'gopal' },
      { id: 2, name: 'sunil' },
      { id: 3, name: 'urvish' },
      { id: 4, name: 'jay' },
      { id: 5, name: 'dharmik' },
 ])
 
    return(
        <div>
                <ul>
                    {obj.map((u,i)=>(
                        <li key={i}>{u.name}</li>
                    ))}
                </ul>
        </div>
    )
}

export default Pro;
